import React from 'react';


export const card = (elem) => {
    const { img } = elem;
    return (
        <>
            <div class="max-w-sm rounded overflow-hidden shadow-lg">
                <img class="w-full" src={img} alt="Sunset in the mountains" />
            </div>
        </>
    )
}
